package net.junyulong.ecc.core.resource;

public enum EecImageResources {
    outline_build_circle_white_24dp(
            "outline_build_circle_white_24dp",
            ""
    ),
    baseline_code_white_24dp(
            "baseline_code_white_24dp",
            ""
    ),
    baseline_help_outline_white_24dp(
            "baseline_help_outline_white_24dp",
            ""
    ),
    outline_add_box_white_24dp(
            "outline_add_box_white_24dp",
            ""
    );

    private final String id;

    private final String hex;

    EecImageResources(String id, String hex) {
        this.id = id;
        this.hex = hex;
    }

    public String getId() {
        return id;
    }

    public String getHex() {
        return hex;
    }
}
